trigger.custom:
function()
    return UnitExists("target") and UnitIsPlayer("target")
end

untrigger.custom:
function()
    return not UnitExists("target") or not UnitIsPlayer("target")
end

triggers.customTriggerLogic:
function(t)
    return t[1] and t[2] and (t[4] or t[5]);
end

function(t)
    return t[1] and t[2] and (t[3] or t[4])
end

function(t)
  return t[1] and t[2] and (t[3] or t[4])
end

function(t)
    return t[1] and t[2] and (t[4] or t[5]);
end

function(t)
    return t[1] and (t[2] or t[3] or (t[4] and t[5]));
end

function(t)
    return t[1] and t[2] and t[3] and (t[4] or t[5]) and t[6];
end

function(t)
    return t[1] and (t[2] or t[3]) and t[4];
end

function(t)
    return t[1] and (t[2] or t[3]) and t[4] and t[5];
end

function (t)
    return t[1] and (t[2] or t[3])
end

function(t)
    return t[1] or t[2] or t[3] or t[4] or t[5] or t[6] or t[7] or t[8] or t[9] or t[10] or t[11]
end
